import {FormControlLabel, Radio, RadioGroup} from "@material-ui/core";
import React, {useEffect, useState} from "react";
import '../styles/components.css';
import {RadioType} from "../objects/enums/RadioType";
import {getTextsByType, getTitleByType} from "../helpers/uiHelper";


export interface ResultCardProps {
    title: string,
    value: string,
}

const ResultCard = ({title, value}:ResultCardProps) => {

    return (
        <div className="resultCard card">
            <text className="resultTitle">{title}</text>
            <text className="resultContent">{value}</text>
        </div>
    );
}

export default ResultCard;
